import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const productData = {}

const Item = () => {
  return (
    <View style={s.conatiner}>
      <Text>Item</Text>
    </View>
  )
}

export default Item

const s = StyleSheet.create({
    conatiner: {
        backgroundColor: 'red',
        flex: 1,
    }
})
